import {
  Row,Col
} from 'reactstrap';
import Example from './Example';
const Layout = () => {
    return (
          <Row>
            <Col xs="2" border="solid 1px"><Example /></Col>
            <Col xs="auto" xl="2" sm="2" md="2" lg="2">Main </Col>
          </Row>
      );
};
export default Layout;
